('mumbai', 'https://scontent.cdninstagram.com/t51.2885-15/s640x640/sh0.08/e35/13102497_222043754853195_1893365261_n.jpg?ig_cache_key=MTIzNjc2NDQzMzk4MDE2NjIxNQ%3D%3D.2.l', 1461653831, 6042, 'https://www.instagram.com/p/BEp3rM2OZBH/', 'image', 'https://scontent.cdninstagram.com/t51.2885-15/s320x320/e35/13102497_222043754853195_1893365261_n.jpg?ig_cache_key=MTIzNjc2NDQzMzk4MDE2NjIxNQ%3D%3D.2.l', 'https://scontent.cdninstagram.com/t51.2885-15/s150x150/e35/c53.0.974.974/12940756_987586987993247_1683940108_n.jpg?ig_cache_key=MTIzNjc2NDQzMzk4MDE2NjIxNQ%3D%3D.2.c', 'fine_dine_love', 'AQBjvaFaoDxU7CYkAfEvdiK-mI1viIcb_k4uL7R33ShWnHV_wROgSy2b5EOPoqNA1IPOvcvRC_URzDknP1kQlZCyNTQKSYlho945qocWuFS9JgJnrrPEjrCsLGSSD3fYkNf3EwUWyWjCoY709oeSHi5p7B_kGLAf_W3P9oUZflD2Gg', 'https://scontent.cdninstagram.com/t51.2885-19/10299659_161921600838145_1063668692_a.jpg', '#NationalPretzelDay\n\nIn the 1,400 years since the #pretzel was invented, #bakers have come up with a wide variety of shapes and flavors. The history of this adaptable snack shows its versatility.\nThe world can thank a frustrated teacher with leftover bread dough for the invention of the soft pretzel. In A.D. 610, while baking bread, an #Italian monk decided to create a treat to motivate his distracted catechism students. He rolled out ropes of dough, twisted them to resemble hands crossed on the chest in prayer, and baked them. The monk christened his snacks pretiola, Latin for "little reward." Parents who tasted their children''s classroom treats referred to them as brachiola, or "little arms." When pretiola arrived in #Germany, they were called bretzels.\n#finedining #finedinelove #food #foodart #gourmetfood #gourmetartistry #foodporn #baking #bake\n#mumbai #mumbaifoodie #mumbaiinstagrammers \n#delhi #delhigram #delhi_igers #eattreat\n#bangalore #bangalorefood #bangalorefoodies #bangalorediaries \n#pune #punefoodie #puneinstagrammers', '', 60),
