('mumbai', 'https://scontent.cdninstagram.com/t51.2885-15/s640x640/sh0.08/e35/13108611_763393170427691_805522110_n.jpg?ig_cache_key=MTIzNjc1ODA4OTIxMTQyMjMzMA%3D%3D.2', 1461653074, 6098, 'https://www.instagram.com/p/BEp2O30iaZ6/', 'image', 'https://scontent.cdninstagram.com/t51.2885-15/s320x320/e35/13108611_763393170427691_805522110_n.jpg?ig_cache_key=MTIzNjc1ODA4OTIxMTQyMjMzMA%3D%3D.2', 'https://scontent.cdninstagram.com/t51.2885-15/s150x150/e35/13108611_763393170427691_805522110_n.jpg?ig_cache_key=MTIzNjc1ODA4OTIxMTQyMjMzMA%3D%3D.2', 'bollywoodartcafe', 'AQCEDoVWjVeSrplFEf_9Xj8darbi1byXa_7ORDY6JPtu7Jh58dSTKIdwcQDSxX8kyMaJeofBq6dFRlaPwnkqb3eqFP9PeBrE7thJ29bASwuk24L92ZTaVnWumILN-0sMww8K1xRQ5VXynwDw2fPQPcTnMy_4AgrQZznv8O2Rzv5J3Q', 'https://scontent.cdninstagram.com/t51.2885-19/s150x150/12960197_234747320217087_462969992_a.jpg', '"I''m acting to be a wrestler, and to act perfectly, you need to do stuff that the real wrestlers do. So, being picked up and being thrown on mat or mitti, it hurts (me) as much it hurts them. Also, picking them up and throwing them is a painful exercise. When they have a match, it''s for about half an hour, but I''m shooting all day. You are grabbing, you are holding, you are patkoing. Also, I am fighting real wrestlers in the film, and so, when they throw you, they throw you really hard. This is my most difficult film. As a kid, when we used to get tired, we''d laugh and still go on till we were exhausted. But today, as soon as you''re tired, you''re like, ''Bas karo yaar, thak gaye. Kal karte hain.'' But sportpersons keep on going and push themselves to the next level. We do compete in the film industry, but that''s different from the competition players participate in. We might think we are working hard, but there''s somebody who is working ten times harder. I am trying to enjoy that pain of learning." - Salman Khan \n@salmankhanmerijaan\n@BOLLYWOODARTCAFE\n#bollywoodartcafe\n.\n.\n.\n#BeingSalmanKhan #SalmanKhan  #Salman #Bollywood  #WeLoveSalmanKhanForever #SultanSK #SULTAN  #SalmanKhanQuote\n#celebrities  #bollywoodactress #bollywoodfashion #fashion #bollywoodactor #bollywood #hindicinema #indiancinema #bollywoodstyle #bandra  #mumbai #punjab #india #instapic #love #fabulous #OOTD #vsco #akshaykumar', '', 37),
